import graphviz
from collections import deque
def min_cost(graph, start, end): 
    dist = {(0,0): float('inf')}
    unvisited = {start}
    while unvisited: 
        parent = deque([(0,0)])
        while parent: 
            node = parent.popleft()
            if node == (start, 0): break
            for neighbor in graph[node]: 
                dist[neighbor] = min(dist[neighbor], dist[node] + graph[node][neighbor])
            unvisited.discard(node)
            unvisited.add((node[0], node[1] + 1))
    return dist[(end[0], end[1])]
