def top_k_frequent(L,k):
    visited = set()
    heap = deque(L)
    frequencies = {}
    while heap:
        elems = heap.popleft()
        for i in elems:
            if i not in visited:
                frequencies[i] = frequencies.get(i,0) + 1
                if frequencies[i] >= k:
                    break
            visited.add(i)
    return list(frequences.items())
